const GreenCard = () => {
  return (
    <div className="bg-yellow-300 flex w-72 gap-3 h-16 border-2">
      <div className="bg-green-500 w-14 h-14 rounded-full">icon</div>
      <div className="text-2xl font-semibold">Available</div>
    </div>
  );
};

export default GreenCard;
